import Navbar from "./component/navbar/navbar.js";
import Footer from "./component/footer/footer.js";
import {
  BrowserRouter,
  Routes,
  Route,
  Switch,
  Link,
} from "react-router-dom";
import "./App.css";
import Home from "./pages/home.jsx";
import About from "./pages/about.jsx";
import Achive from "./pages/achive.jsx";
import Project from "./pages/project.jsx";
import Product from "./pages/product.jsx";
import Partnert from "./pages/partner.jsx";
import Artikel from "./pages/artikel.jsx";
import Detail from "./pages/detail.jsx";
import { useEffect } from "react";

function App() {
  // const current = window.location.pathname;

  // console.log(current)

  const location = useLocation();
  useEffect(() => {
    console.log(location);
  }, [location.pathname]);

  return (
    <BrowserRouter>
      {/* {current !== "/detail" && <Navbar />} */}

      <Navbar />

      <Routes>
        <Route path="/home" element={<Home />} />
        <Route path="/about" element={<About />} />
        <Route path="/achive" element={<Achive />} />
        <Route path="/project" element={<Project />} />
        <Route path="/product" element={<Product />} />
        <Route path="/partner" element={<Partnert />} />
        <Route path="/artikel" element={<Artikel />} />
        <Route path="/detail" element={<Detail />} />
      </Routes>
      {/* {current !== "/detail" && <Footer />} */}
      <Footer />
    </BrowserRouter>
  );
}

export default App;
